import axios from "axios";

const BASE_URL = "http://localhost:2929/api/";
const TOKEN ='eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJlbWFpbCI6Im5AZ21haWwuY29tIiwiaWF0IjoxNjM3NTc2MDQ0LCJleHAiOjE2Mzc4MzUyNDR9.1lBFF2c59Bqut5L8vLO55oxaDAXoLkS5brsB-rv-6ng'//JSON.parse(JSON.parse(localStorage.getItem("persist:root")).user).currentUser.accessToken;

export const publicRequest = axios.create({
  baseURL: BASE_URL,
});

export const userRequest = axios.create({
  baseURL: BASE_URL,
  header: { token: `Bearer ${TOKEN}` },
});
